import React from "react";

export default function Contact() {
  return (
    <section className="py-10 md:py-[60px]">
      <div className="container">
        <div>
          <form action="#">
            <input type="text" placeholder="Your name" className="border border-so"/>
            <input type="email" placeholder="Email" className="border border-so"/>
            <textarea placeholder="How can I help?*"></textarea>
          </form>
          <div></div>
        </div>
      </div>
    </section>
  );
}
